    "Signing in...": "Connexion en cours...",
    "Single Edition allows a designer to use Adobe InDesign to build an iPad app with engaging elements such as slideshows, embedded audio and video, image pan, zoom and panoramas, 360-degree object rotation and more - all without writing code. Using only tools created by Adobe, you can create engaging apps with lots of interactivity. The apps built can be submitted and sold through the Apple App Store. Single Edition is now included as part of an Adobe Creative Cloud membership. The following instructions will help you get started!": "L’édition Single permet aux concepteurs d’utiliser Adobe InDesign afin de créer une application pour iPad contenant des éléments attractifs, comme des diaporamas, des vidéos et des sons intégrés, un panoramique sur les images, des fonctions de zoom et de panorama, la rotation des objets à 360 degrés, et bien plus encore, tout cela sans écrire le moindre code. Simplement à l’aide des outils mis au point par Adobe, vous pouvez créer des applications séduisantes, avec une grande interactivité. Les applications ainsi créées peuvent être envoyées et vendues par le biais de l’App Store d’Apple. L’édition Single est désormais incluse dans les abonnements Adobe Creative Cloud. Les instructions ci-après vous aideront à vous familiariser avec le produit.",
