    "We're sorry, but we can't complete this upload because it would exceed our limit for the maximum number of items in your account. Please empty your archive or delete some items and try again.": "Malheureusement, ce chargement ne peut aboutir car votre compte comporterait alors plus d’éléments que la limite autorisée. Videz vos archives ou supprimez quelques éléments et réessayez.",
    "We're sorry, but you can't archive these items because your archive is too full. Please permanently delete some items in your archive and try again.": "Malheureusement, vous ne pouvez pas archiver ces éléments car vos archives sont pleines. Supprimez définitivement quelques éléments de vos archives et réessayez.",
    "We're sorry, but you can't archive this item because your archive is too full. Please permanently delete some items in your archive and try again.": "Malheureusement, vous ne pouvez pas archiver cet élément car vos archives sont pleines. Supprimez définitivement quelques éléments de vos archives et réessayez.",
    "We're sorry, but you can't create a new folder because it would exceed our limit for the maximum number of items in your account. Please empty your archive or delete some items and try again.": "Malheureusement, vous ne pouvez plus créer de dossier car votre compte comporterait alors plus d’éléments que la limite autorisée. Videz vos archives ou supprimez quelques éléments et réessayez.",
    "We're sorry, but you can't create a new folder because it would exceed our limit for the maximum number of nested subfolders. Please create your new folder in a different directory.": "Malheureusement, vous ne pouvez plus créer de dossier ici : vous dépasseriez alors le nombre maximum de sous-dossiers imbriqués. Vous pouvez créer votre dossier dans un autre répertoire.",
    "We're sorry, but you can't move new items to this folder because it would exceed our limit for the maximum number of items per folder. Please delete some items and try again.": "Malheureusement, vous ne pouvez plus déplacer d’éléments vers ce dossier car la limite fixée a été atteinte. Supprimez quelques éléments et réessayez.",
    "We're sorry, but you can't move this folder because the destination folder has exceeded our limit for the maximum number of nested subfolders. Please move this folder to a different directory.": "Malheureusement, vous ne pouvez pas déplacer ce dossier car le dossier de destination excède le nombre maximum de sous-dossiers imbriqués. Vous pouvez déplacer ce dossier vers un autre répertoire.",
    "We're sorry. You can't share this folder because at least one of its sub-folders has collaborators.{0} To share this folder, first remove all collaborators from its sub-folders, then re-invite everyone to this folder. When you add collaborators to a folder, its sub-folders are automatically shared with the same people.": "Désolé, vous ne pouvez pas partager ce dossier car au moins l’un de ses sous-dossiers est associé à des collaborateurs.{0} Pour partager ce dossier, supprimez d’abord tous les collaborateurs des sous-dossiers, puis réinvitez chacun à collaborer sur le dossier lui-même. Lorsque vous ajoutez des collaborateurs à un dossier, ses sous-dossiers sont automatiquement partagés avec les mêmes personnes.",
    "We\\'re rolling out file sync in limited batches to Creative Cloud members. Sign up here to register for early access. We\\'ll add you to the waiting list, and send you an email once you\\'re in.": "Nous déployons actuellement la synchronisation de fichiers en octroyant un nombre limité d’accès aux membres Creative Cloud. Inscrivez-vous ici pour bénéficier d’un accès en avant-première. Vous serez ajouté à la liste d’attente et recevrez un e-mail une fois que votre demande aura abouti.",
    "We\\'re sorry, this file cannot be shared due to the detection of copyrighted material. {0}Learn more{1}.": "Désolé, ce fichier ne peut pas être partagé, il est protégé par copyright. {0}En savoir plus{1}.",
    "We\\'re sorry, this file type cannot be shared at this time. {0}Learn more{1}.": "Désolé, il n’est pas possible de partager ce type de fichier pour le moment. {0}En savoir plus{1}.",
    "We\\'re sorry, we had trouble adding your comment. Please refresh the page and try again.": "Malheureusement, nous ne sommes pas parvenus à ajouter votre commentaire. Veuillez actualiser la page et réessayer.",
