    "We\\'re sorry. We have encountered an error while processing your cancellation. Please contact {0}Customer Support{1} to cancel your membership.": "Une erreur s’est produite pendant le traitement de votre demande de résiliation. Veuillez contacter le {0}Service clientèle{1} pour résilier votre abonnement.",
    "We\\'re working quickly to resolve the issue and we apologize for the delay. If you have the Creative Cloud app already installed on your machine, you can try using it to access new downloads and updates. Otherwise, please check back or see our {0}status site{1} for updates.": "Nous tentons de résoudre ce problème au plus vite et nous excusons de cette attente. Si l’application Creative Cloud est déjà installée sur votre ordinateur, vous pouvez tenter de l’utiliser pour accéder aux nouveaux téléchargements et mises à jour. Dans le cas contraire, revenez sur cette page ultérieurement ou consultez l’{0}état du site{1} pour être informé de toute évolution.",
    "We\\'re working quickly to resolve the issue and we\\'re sorry for the delay. Please check back or see our {0}status site{1} for updates. Also, help is available in the {2}Creative Cloud forums{3}.": "Nous tentons de résoudre ce problème au plus vite et nous excusons de cette attente. Veuillez revenir sur cette page ultérieurement ou consulter l’{0}état du site{1} pour être informé de toute évolution. Vous pouvez également obtenir de l’aide sur les {2}forums Creative Cloud{3}.",
    "We\\'re working quickly to resolve the issue and we\\'re sorry for the delay. Please check back or see our {0}status site{1} for updates. Also, help is available in the {2}forums{3}.": "Nous tentons de résoudre ce problème au plus vite et nous excusons de cette attente. Veuillez revenir sur cette page ultérieurement ou consulter l’{0}état du site{1} pour être informé de toute évolution. Vous pouvez également obtenir de l’aide sur les {2}forums{3}.",
