    "Width": "Largeur",
    "With Digital Publishing Suite, Single Edition, you can use familiar InDesign skills to create, develop, and deliver iPad apps like brochures, portfolios, yearbooks and annual reports&#8212;with engaging interactive elements such as slideshows, embedded audio and video, pan and zoom images, panoramas, 360-degree object rotation and more&#8212;without writing code. Single Edition is now included as part of Adobe Creative Cloud. With a Creative Cloud membership, you can build an unlimited number of iPad apps and submit to the Apple App Store. Follow these instructions to get started!": "Avec Digital Publishing Suite, édition Single, vous pouvez exploiter vos compétences InDesign habituelles pour créer, développer et publier des applications pour iPad telles que des brochures, des dossiers de présentation, des annuaires et des rapports annuels (comportant des éléments interactifs attractifs comme des diaporamas, des sons et des films intégrés, des images avec zoom et panoramique, des panoramas, la rotation d’objets à 360 degrés, et bien plus encore), le tout sans écrire le moindre code. L’édition Single est désormais intégrée à Adobe Creative Cloud. Avec un abonnement Creative Cloud, vous pouvez créer un nombre illimité d’applications pour iPad et les envoyer à l’App Store d’Apple. Pour vous lancer, suivez les instructions fournies !",
